INSERT INTO spree_content_blocks VALUES(33,10,'richtext','',replace(replace('<h2>Konsent</h2>\r\n\r\n<hr />\r\n<p>Es ist wichtig, dass alle Beteiligten jederzeit freiwillig und bewusst ihre Zustimmung geben und dass die Grenzen und W&uuml;nsche von allen respektiert werden. Im Osada Kinbaku Dojo e.V. legen wir gro&szlig;en Wert auf die Bedeutung von Konsent, um eine sichere und positive Erfahrung f&uuml;r alle Beteiligten zu gew&auml;hrleisten.&nbsp;</p>\r\n\r\n<p>Das Konzept des &quot;Wheel of Consent&quot; nach Betty Martin ist ein wichtiger Bestandteil unseres Ansatzes, um sicherzustellen, dass alle Handlungen einvernehmlich erfolgen und die W&uuml;nsche und Grenzen aller Beteiligten individuell respektiert werden.</p>\r\n\r\n<p>Das Rad besteht aus vier Quadranten:&nbsp;<br />\r\nDienen, Nehmen, Erlauben und Annehmen&nbsp;<br />\r\n&nbsp;<br />\r\nDiese Aspekte helfen, die verschiedenen Zustimmungsdynamiken zwischen zwei oder mehreren Personen zu verstehen. Der Fokus des Wheels of Consent liegt darauf, dass jeder Einzelne bewusst entscheidet, was er oder sie geben und empfangen m&ouml;chte, und dass dies klar kommuniziert wird.<br />\r\n<br />\r\nKostenloses Infomaterial zum Wheel of Consent findet ihr auf der Seite von Betty Martin: <a href="https://bettymartin.org/wp-content/uploads/2020/10/German.pdf" target="_blank">Wheel of Consent</a></p>\r\n\r\n<p>Es ist trotzdem wichtig zu beachten, dass alles Wissen und Lernen auch hier dem Minimieren der Risiken dient. Das Risiko eines Konsent-Unfall, damit meinen wir das unbewusste und nicht beabsichtigte &Uuml;bertreten einer Grenze, kann wie bei den physischen Unf&auml;llen, nur sehr schwer komplett vermieden werden.<br />\r\nHier ist es wichtig, einen wohlwollenden Umgang miteinander zu pflegen, Verantwortung zu &uuml;bernehmen und Reflektion zuzulassen. In Einzelf&auml;llen kann es sinnvoll sein, eine*n Mediator*in einzuschalten. Falls ihr ein Anliegen habt, scheut euch nicht, uns anzusprechen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Eine Person ohne deren Zustimmung zu fesseln oder Handlungen vorzunehmen, zu denen sie nicht zugestimmt hat, stellt einen Straftatbestand dar.&nbsp;<br />\r\nUnd auch wenn dies in der Umkehrung nicht auf aktiv fesselnde&nbsp;Personen zutrifft,&nbsp;sind dennoch auch deren Grenzen klar zu achten.</p>\r\n\r\n<p>&nbsp;</p>\r\n','\r',char(13)),'\n',char(10)),1,270,'2023-11-16 13:51:02.531552','2023-11-16 17:53:12.340904',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(34,1,'three_squares','Vereins Trenner 1',NULL,1,40,'2023-11-16 16:53:13.934495','2024-02-03 12:52:33.680927',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(36,7,'richtext','',replace(replace('<p><strong>Ben&ouml;tige ich Vorkenntnisse?</strong><br />\r\nDu ben&ouml;tigst keine Vorkenntnisse, da nach der Didaktik erst die Grundlagen vermittelt und gepr&uuml;ft werden, bevor es an komplexere Fesselungen geht</p>\r\n\r\n<p><strong>Sportliche Bekleidung</strong><br />\r\nAllgemein kann man sagen, dass wir ein Sportverein sind. Daher trainieren wir in sportlicher Kleidung ohne Schuhe. Trainiert wird Barfu&szlig; oder in Socken.<br />\r\nWir bitten Euch auf Stra&szlig;enkleidung zu verzichten. Kommt in bequemer sportlicher Kleidung, idealerweise enganliegend.&nbsp;T-Shirt und Hose sind bestens geeignet.<br />\r\nZu weite Kleidung, Kn&ouml;pfe oder B&uuml;gel-BHs k&ouml;nnen Druckstellen verursachen, und k&ouml;nnten im schlimmsten Fall sogar zu Verletzungen f&uuml;hren. Beliebt sind daher Sporthosen ohne Druckkn&ouml;pfe oder Rei&szlig;verschl&uuml;sse, Leggins, Strumpfhosen, Tops oder T-Shirts. Ihr k&ouml;nnt Euch bei uns vor Ort umzuziehen. Am Ende des Trainings wird ohnehin alles voller Fusseln sein.&nbsp;</p>\r\n\r\n<p>Kommt Ihr zu einem Workshop kann die gew&uuml;nschte Bekleidung anders sein, je nach Thema und ob der Workshop theoretisch oder praktisch ist. In der jeweiligen Workshop-Beschreibung findet Ihr auch Details, auch ob Ihr Euch zu Zweit oder als Einzelperson anmelden m&uuml;sst.</p>\r\n\r\n<p><strong>Wird auf mich individuell eingegangen?</strong><br />\r\nEs ist Gruppenunterricht, aber alle lernen in ihrem eigenen Tempo. Unterschiedliche Level trainieren nebeneinander. Unsere Trainerinnen und Trainer korrigieren in&nbsp;1 zu 1&nbsp;Situationen, geben Tipps zu Technik und K&ouml;rperhaltung und Wiederholen die Elemente mit Dir oder zeigen den n&auml;chsten Schritt.</p>\r\n\r\n<p><strong>Ich habe noch keine eigenen Seile, welche Seile eigenen sich f&uuml;r Bondage?</strong><br />\r\nDu kannst Dir anfangs Seile von uns leihen. Wir fesseln ausschlie&szlig;lich mit Jute (oder Hanfseilen). Diese m&uuml;ssen jedoch vorher aufw&auml;ndig bearbeitet werden.</p>\r\n\r\n<p>Es ist sinnvoll, dass Du verschiedene Seile in die Hand nimmst, bevor Du eine Kaufentscheidung triffst. Im Training kannst Du viele verschiedene Seiltypen sehen und andere Sch&uuml;ler:innen&nbsp;fragen, ob Du ihre Seile einmal ausprobieren kannst. Verschiedene Personen haben unterschiedliche Vorlieben was das richtige Seil betrifft und k&ouml;nnen Dir Tipps geben.</p>\r\n\r\n<p><strong>Kann ich mir eine Flasche Wasser zum Training mitbringen?</strong><br />\r\nDu solltest Dein eigenes&nbsp;Getr&auml;nk in einen&nbsp;wiederverschlie&szlig;baren Flasche&nbsp;und&nbsp;auch etwas zu&nbsp;Essen mitbringen. Wir verkaufen keine Getr&auml;nke.</p>\r\n\r\n<p><strong>Was passiert wenn ich kurzfristig (aus wichtigen Gr&uuml;nden) absagen muss?</strong><br />\r\nNat&uuml;rlich kannst du absagen, aber es w&auml;re dann auch gut, wenn du das rechtzeitig machst.&nbsp;Um Dir Kosten zu ersparen, versuchen wir die frei werdenden Pl&auml;tze&nbsp;aufzuf&uuml;llen.<br />\r\nTrainings finden in Mietr&auml;umen statt. Daher bitten wir um Dein Verst&auml;ndnis, dass wir bei kurzfristiger Absage keine R&uuml;ckerstattung erm&ouml;glichen k&ouml;nnen.<br />\r\nBitte halte eine Frist von mindestens 24h f&uuml;r eine Absage ein.<br />\r\nBei Workshops kann sich das ein wenig anders gestalten.</p>\r\n','\r',char(13)),'\n',char(10)),1,50,'2023-11-16 17:24:10.608414','2023-11-16 18:06:36.432246',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(37,7,'three_squares','',NULL,1,40,'2023-11-16 17:24:23.697537','2023-11-16 18:06:36.424876',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(38,9,'richtext','',replace(replace('<h2>Gesundheitliche Risiken</h2>\r\n\r\n<hr />\r\n<p>Shibari&nbsp;kann gesundheitliche Risiken mit sich bringen, insbesondere wenn es falsch durchgef&uuml;hrt wird oder wenn die Beteiligten keine Erfahrung haben.<br />\r\nHier sind einige m&ouml;gliche Risiken:</p>\r\n\r\n<p><strong>Durchblutungsst&ouml;rungen:</strong><br />\r\nH&auml;ufig wird durch die Seile Druck auf bestimmte K&ouml;rperbereiche ausge&uuml;bt, was zu Durchblutungsst&ouml;rungen f&uuml;hren kann. Wenn der Druck zu lange anh&auml;lt, k&ouml;nnen Blutgef&auml;&szlig;e besch&auml;digt werden, was wiederum zu Schmerzen und sogar Sch&auml;den f&uuml;hren kann.</p>\r\n\r\n<p><strong>Atembeschwerden:</strong><br />\r\nEine falsch ausgef&uuml;hrte Technik oder ein falsch angebrachtes Seil kann zu Atembeschwerden f&uuml;hren, insbesondere wenn der Hals oder der Brustkorb betroffen sind. Dies kann zu Erstickungsgefahr oder Hyperventilation/Panik&nbsp;f&uuml;hren.</p>\r\n\r\n<p><strong>K&ouml;rperliche Ersch&ouml;pfung:</strong><br />\r\nShibari erfordert oft eine gewisse k&ouml;rperliche Anstrengung von den Beteiligten, da es oft l&auml;ngere Zeit in einer bestimmten Position gehalten wird. Wenn die Beteiligten nicht in der Lage sind, diese Anstrengung auszuhalten, kann es zu k&ouml;rperlicher Ersch&ouml;pfung oder Kr&auml;mpfen kommen.</p>\r\n\r\n<p><strong>Kleine oberfl&auml;chliche Verletzungen:</strong><br />\r\nAbdr&uuml;cke vom Seil (in der Regel sind die ein paar Stunden sp&auml;ter verschwunden), ausgerissen Haare, Kratzer, blaue Flecken, Seilverbrennungen.<br />\r\nEgal wie vorsichtig die Person die dich fesselt ist, das Risiko kleiner oberfl&auml;chlicher Verletzungen l&auml;sst sich kaum vollst&auml;ndig beseitigen.</p>\r\n\r\n<p><strong>Nervensch&auml;den:</strong><br />\r\nBei unsachgem&auml;&szlig;er Anwendung von Shibari-Techniken oder durch Verwendung von ungeeigneten Materialien oder bei zu fest angelegten&nbsp;Seilen kann es zu Nervensch&auml;den kommen, die Schmerzen, Taubheitsgef&uuml;hle oder sogar dauerhafte Sch&auml;den verursachen k&ouml;nnen.&nbsp;Die sachgemaesse Anwendung minimiert die Gefahr, einen Nervenschaden zu erleiden.</p>\r\n\r\n<p>Nervensch&auml;den&nbsp;k&ouml;nnen auftreten, wenn sensorische oder motorische Nerven f&uuml;r eine gewisse Zeit zu stark oder zu lange komprimiert werden.</p>\r\n\r\n<p>In der Regel k&ouml;nnen sensorische Nerven nach einigen Stunden bis zu Wochen vollst&auml;ndig wiederhergestellt sein. Die Beeintr&auml;chtigung ist normalerweise nicht schwerwiegend - manche Menschen st&ouml;ren&nbsp;sich jedoch sehr an dem Gef&uuml;hl.</p>\r\n\r\n<p>Motorische Nerven k&ouml;nnen ebenfalls ausfallen. Es gibt verschiedene Fr&uuml;hwarnsysteme, auf die dringend geachtet werden muss, und eine gemeinsame Aufmerksamkeit ist dringend erforderlich. Die vollst&auml;ndige Regenerationsdauer eines Nervs variiert von Stunden bis zu Monaten. Zu den Symptomen geh&ouml;ren die &quot;Fallhand&quot; (durch Kompression des Nervus radialis) oder die Gegenbewegung &quot;Greifhand&quot; (durch Kompression des Nervus ulnaris). Da diese Symptome den Alltag erheblich beeintr&auml;chtigen k&ouml;nnen, ist es &auml;u&szlig;erst wichtig, alles zu unternehmen, um solche Sch&auml;den zu vermeiden.</p>\r\n\r\n<p><strong>Ohnmacht/Zusammenbruch von Kreislauf&nbsp;(unterschiedliche&nbsp;Ursachen):</strong><br />\r\nDas Auftreten von Ohnmacht oder einem Kreislaufzusammenbruch kann verschiedene Ursachen haben und ist in der Regel nicht die gef&auml;hrlichste Situation. Dennoch kann dies die gefesselte Person in einen Schock versetzen, und in solchen Momenten ist eine schnelle und angemessene Reaktion entscheidend. Aufgrund des Verlusts der K&ouml;rperspannung bei der gefesselten Person &auml;ndert sich die Art der physischen Interaktion. Es besteht die Gefahr schwerwiegender Verletzungen durch unsachgem&auml;&szlig;es Verhalten, was m&ouml;glicherweise eine gr&ouml;&szlig;ere Bedrohung darstellen kann als die kurzzeitige Ohnmacht selbst.</p>\r\n\r\n<p>Wir sind der festen &Uuml;berzeugung, dass regelm&auml;&szlig;iges &Uuml;ben dazu beitr&auml;gt, in Paniksituationen die richtigen Entscheidungen zu treffen, &auml;hnlich wie bei Brandschutz&uuml;bungen. Sollte die gefesselte Person vor einer Ohnmacht bemerken, dass ihr Kreislauf absackt, sollte sie dies umgehend mitteilen, damit die angemessenen Reaktionen eingeleitet werden k&ouml;nnen. Die Sicherheit und das Wohlbefinden der Beteiligten haben oberste Priorit&auml;t, und eine angemessene Schulung und Vorbereitung sind entscheidend, um auf unvorhergesehene Situationen richtig zu reagieren.</p>\r\n\r\n<p><strong>Gelenksch&auml;den</strong>:<br />\r\nDer Bereich der Gelenkgesundheit ist bislang weniger erforscht, da er normalerweise nicht zu den Unf&auml;llen geh&ouml;rt, sondern vielmehr den Bereich der &quot;Abnutzung&quot; betrifft. Hier k&ouml;nnen eindeutige Aussagen oft schwierig sein.</p>\r\n\r\n<p>Es ist wichtig zu beachten, dass Gelenke m&ouml;glichst nicht &uuml;berlastet werden sollten, sei es durch wiederholte Belastung &uuml;ber einen l&auml;ngeren Zeitraum oder durch kurzzeitige, &uuml;berm&auml;&szlig;ige Beanspruchung. Oft bemerkt man die Sch&auml;den erst sp&auml;ter, aber ein einmal gesch&auml;digtes Knie wird m&ouml;glicherweise nie wieder vollst&auml;ndig heilen.</p>\r\n\r\n<p>Besonders gef&auml;hrdete Gelenke sind die Schultern und Knie, aber auch die Gelenke in den Fingern der fesselnden Person und Ellenbogen k&ouml;nnen beeintr&auml;chtigt werden. Daher ist es von gr&ouml;&szlig;ter Bedeutung, auf die Gesundheit eurer Gelenke zu achten. Vermeidet Querbelastung und &uuml;berm&auml;&szlig;ige Beanspruchung. Solltet ihr Schmerzen in den Gelenken versp&uuml;ren, ist es &auml;u&szlig;erst wichtig, dies umgehend mitzuteilen, um dauerhafte schwerwiegende Beeintr&auml;chtigungen zu minimieren. Eure Gelenkgesundheit sollte immer oberste Priorit&auml;t haben.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Shibari ist R.A.C.K.</h2>\r\n\r\n<hr />\r\n<p>Vielleicht habt ihr bereits von Safe, Sane, Consensual (SSC - Sicher, Vern&uuml;nftig, Einvernehmlich)&nbsp;geh&ouml;rt. Wir glauben, dass Shibari-Praktiken nicht vollst&auml;ndig in dieses Konzept passen. Stattdessen ordnen wir sie dem Konzept Risk Aware Consensual Kink (RACK - Risikobewusste&nbsp;einvernehmliche Praktiken)&nbsp;zu.<br />\r\n<br />\r\nDabei gehen wir davon aus, dass in einigen Shibari-Praktiken ein gewisses Restrisiko besteht, das trotz aller Vorsichtsma&szlig;nahmen nicht vollst&auml;ndig ausgeschlossen werden kann. Um dieses Restrisiko entsprechend zu minimieren, ist eine enge Zusammenarbeit zwischen allen Beteiligten unerl&auml;sslich.</p>\r\n\r\n<p>Damit diese Zusammenarbeit effektiv funktionieren kann, m&uuml;sst ihr euch alle klar dar&uuml;ber sein, welche Risiken bestehen und worauf ihr achten solltet.<br />\r\nDies erfordert ein tiefes Verst&auml;ndnis der angewandten Techniken sowie offene Kommunikation.&nbsp;</p>\r\n\r\n<p>Mit unserem Ansatz betonen wir die Bedeutung von Risikobewusstsein, Kommunikation und gemeinsamer Verantwortung. Er erm&ouml;glicht es euch, eure Vorlieben und Fantasien auszuleben, w&auml;hrend ihr euch der potenziellen Risiken bewusst seid und gemeinsam daran arbeitet, diese zu minimieren und zu bew&auml;ltigen.</p>\r\n\r\n<p>Es ist beruhigend zu wissen, dass Wissen und Achtsamkeit dazu beitragen k&ouml;nnen, die meisten schwerwiegenden Unf&auml;lle zu verhindern.<br />\r\nDennoch m&ouml;chten wir einige Aspekte ansprechen, &uuml;ber die ihr euch im Vorfeld klar sein solltet, um unangenehme &Uuml;berraschungen zu vermeiden.<br />\r\nJeder von euch sollte individuell bewerten, wie schwerwiegend bestimmte Situationen sein k&ouml;nnten.Nach unserer Einsch&auml;tzung sind die Gefahren im Shibari vielleicht sogar geringer als bei anderen Sportarten, jedoch solltet ihr euch dessen bewusst sein.</p>\r\n','\r',char(13)),'\n',char(10)),1,30,'2023-11-16 17:27:44.047773','2023-11-16 17:29:13.947374',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
