INSERT INTO spree_content_blocks VALUES(43,1,'richtext','',replace(replace('<p>Herzlich willkommen auf der Website des Osada Kinbaku Dojo e.V., dem Ort f&uuml;r Shibari-Begeisterte in Berlin!<br />\r\n<br />\r\nUnser gemeinn&uuml;tziger Verein widmet sich der Vermittlung der japanischen Seilkunst <a href="/infos">Shibari</a>&nbsp;&ndash; auch bekannt als Kinbaku&nbsp;&ndash; sowie der Schaffung einer Gemeinschaft von Menschen, die sich f&uuml;r die Kunst des Fesseln interessieren. Unser Shibari-Dojo bietet regelm&auml;&szlig;ige Unterrichtseinheiten und Workshops an, die das Erlernen und Verfeinern von Techniken und Fertigkeiten im Umgang mit Seilen erm&ouml;glichen. Dabei legen wir besonderen Wert auf k&ouml;rperliche und seelische Gesundheit sowie das Respektieren der Grenzen anderer.<br />\r\n<br />\r\nWir unterrichten Shibari in Theorie und Praxis nach unserer Interpretation des klassischen Osada Ryu. Wie in einem Dojo &uuml;blich, lernen unsere Sch&uuml;ler:innen in ihrer jeweiligen Geschwindigkeit, also ohne Zeitdruck, die Inhalte sicher, pr&auml;zise und &auml;sthetisch umzusetzen.<br />\r\n<br />\r\nWir laden Euch herzlich ein, unsere Leidenschaft und unser Dojo kennenzulernen und in die faszinierende Welt des Shibari einzutauchen.<br />\r\n<br />\r\nSchaut Euch um&nbsp;&ndash; wir freuen uns auf Euch!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="https://dev.kinbaku-berlin.de/products">N&auml;chste Termine</a></p>\r\n','\r',char(13)),'\n',char(10)),1,30,'2023-11-16 18:04:53.593814','2024-01-27 12:24:59.537490',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(44,7,'richtext','',replace(replace('<h2>Vor dem ersten Besuch</h2>\r\n\r\n<hr />\r\n<p>Unsere Trainings sind kein&nbsp;Playspace&nbsp;und zielen auf eine sportlich formale und technische Atmosph&auml;re ab.</p>\r\n\r\n<p>Wollt Ihr bei uns aktiv fesseln lernen, m&uuml;sst Ihr einmalig unseren Einf&uuml;hrungs-Workshop besuchen. Dort bekommt Ihr alle wichtigen Informationen f&uuml;r den reibungslosen Einstieg und lernt die ersten Fesselungen, die Ihr im Training wiederholt und vertieft. Informationen zum Einf&uuml;hrungsworkshop findet Ihr <a href="einfuehrungsveranstaltung">hier</a>.</p>\r\n\r\n<p>Begleitest Du jemanden zum Training, um dich fesseln zu lassen,&nbsp;musst Du den Einf&uuml;hrungs-Workshop selbst nicht besucht haben.</p>\r\n\r\n<p>Au&szlig;erdem empfehlen wir Euch vor dem ersten Besuch folgende Links gr&uuml;ndlich zu lesen.</p>\r\n\r\n<p><a href="/sicherheit-und-risiken">Sicherheit und Risiken</a><br />\r\n<a href="/konsent">Konsens</a><br />\r\n<a href="/konsent-im-workshop-und-training">Konsens im Training</a></p>\r\n','\r',char(13)),'\n',char(10)),1,30,'2023-11-16 18:06:20.185709','2023-11-16 18:06:36.413997',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
