INSERT INTO spree_content_blocks VALUES(49,1,'richtext','Ziele des Vereins',replace(replace('<p><em><strong>Ziele des Vereins</strong></em></p>\r\n\r\n<hr />\r\n<p><br />\r\nDer Verein hat sich zum Ziel gesetzt, Menschen mit Interesse an Shibari zu verbinden und diese in den Bereichen Handwerk und Technik, Sicherheit und Consent, Bewegungsoptimierung und &Auml;sthetik zu f&ouml;rdern. Dabei spielt die europ&auml;ische Interpretation der japanischen Herkunft eine wichtige Rolle.<br />\r\n<br />\r\nEin weiteres Ziel des Trainings ist es, das Muskelged&auml;chtnis zu schulen, um eine m&ouml;glichst hohe Sicherheit zu gew&auml;hrleisten und Risiken zu minimieren. Durch gezielte Wiederholung einzelner &Uuml;bungen entsteht Routine, die in Gefahrensituationen Ruhe und Sicherheit verleiht.<br />\r\n<br />\r\nAu&szlig;erdem vermitteln wir,&nbsp;im Austausch mit praktizierenden Mediziner:innen, grundlegende Kenntnisse in&nbsp;Anatomie und Physiologie.<br />\r\n<br />\r\nBesonders wichtig ist dem Verein, dass seine Mitglieder ein fundiertes Sicherheitswissen erlangen, sowohl praktisch als auch theoretisch. Au&szlig;erdem erhalten sie Zugang zu medizinischen und rechtlich relevanten Themen sowie aktuellen Diskussionen.&nbsp;</p>\r\n','\r',char(13)),'\n',char(10)),1,50,'2024-02-03 12:30:19.842652','2024-02-03 12:50:07.092834',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(50,1,'richtext','Mitgliedschaften',replace(replace('<p><em><strong>Mitgliedschaften</strong></em></p>\r\n\r\n<hr />\r\n<p>F&uuml;r Mitgliedschaften erheben wir Beitr&auml;ge, wie Ihr es aus anderen Vereinen kennt. Diese werden in der Regel von der fesselnden Person bezahlt und beinhalten selbstverst&auml;ndlich ein Mitbringen von Trainingspartner:innen. Anfangs empfehlen wir Tagesmitgliedschaften zu nutzen und erst in den Verein einzutreten, wenn sich eine gewisse Regelm&auml;&szlig;igkeit abzeichnet.<br />\r\n<br />\r\n<strong>Tagesmitgliedschaften</strong></p>\r\n\r\n<p>Eine Trainingseinheit kostet 20&euro;.</p>\r\n\r\n<p>Beispiel 1. Da sich die Vereinsmitgliedschaften insbesondere an die&nbsp;Rigger&nbsp;richte, welche mit verschiedenen Trainingspartener*innen kommen k&ouml;nnen, wird in der Regel die Tagesmitgliedschaft von den Riggern &uuml;bernommen.</p>\r\n\r\n<p>Beispiel 2: H&auml;ufig finden sich Leute zum &quot;switchen&quot; das hei&szlig;t sie wechseln sich mit dem&nbsp;aktiven Fesseln beim Training ab. Dann k&ouml;nnt ihr euch die Kosten teilen.</p>\r\n\r\n<p>Beispiel 3. Switchen mit Vereinsmitglied. Kostet 10&euro; pro Trainingseinheit f&uuml;r das Nichtmitglied.<br />\r\n<br />\r\n<strong>Einzelunterricht</strong></p>\r\n\r\n<p>Ihr wollt lieber Einzelunterricht? Auch das ist nat&uuml;rlich m&ouml;glich, sogar zu variablen Tageszeiten an unterschiedlichen Standorten in Berlin oder bei euch Zuhause. Schreibt uns eine E-Mail.<br />\r\n<br />\r\n<strong>Berlinbesuch</strong></p>\r\n\r\n<p>Ihr interessiert euch f&uuml;r das Training des Osada Kinbaku Dojo Berlins, ihr m&ouml;chtet Einzelunterricht oder verabredet euch mit einem weiteren Paar zum Unterricht. Meldet euch bei uns per E-Mail und wir besprechen die Konditionen.</p>\r\n\r\n<p><a href="/einzelunterricht">Hier</a> findet Ihr weitere Infos zu individuellen Trainings.</p>\r\n','\r',char(13)),'\n',char(10)),1,70,'2024-02-03 12:31:12.891656','2024-02-03 12:50:07.116916',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO spree_content_blocks VALUES(51,1,'richtext','Trainer und Trainerinnen',replace(replace('<p><em><strong>Trainerinnen und Trainer</strong></em></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p>Hagen:&nbsp;</p>\r\n\r\n<p>Arlis:&nbsp;</p>\r\n\r\n<p>Alex:</p>\r\n\r\n<p>Lilly:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Auch Gasttrainer k&ouml;nnen ggf. mal aushelfen.</p>\r\n','\r',char(13)),'\n',char(10)),1,90,'2024-02-03 12:43:15.162650','2024-02-03 12:52:04.177869',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
